package jquery.vo;

public class Emp {
	int id;
	String name;
	public Emp(int id, String name) {
		// TODO Auto-generated constructor stub
		this.id=id;
		this.name =name;
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	
}
